import Link from "next/link";

const linkStyle = {
  marginRight: 15,
  color: "skyblue",
  fontSize: "18"
};

const Header = () => (
  <div>
    <Link href="/">
      <a style={linkStyle}>Home</a>
    </Link>
    <Link href="/about">
      <a style={linkStyle}>About</a>
    </Link>
  </div>
);

export default Header;
